import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
  const [pnombre, setPnombre] = useState('');
  const [edad, setEdad] = useState(0);
  const [ubicacion, setUbicacion] = useState('');
  const [identificacion, setIdentificacion] = useState('');
  const [sNombre, setSNombre] = useState('');
  const [pApellido, setPApellido] = useState('');
  const [sApellido, setSApellido] = useState('');
  const [email, setEmail] = useState('');
  const [fechaNacimiento, setFechaNacimiento] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const edadCalculada = calculateAge(fechaNacimiento);
    setEdad(edadCalculada);

    const personaData = {
      pnombre,
      edad: edadCalculada,
      ubicacion,
      identificacion,
      sNombre,
      pApellido,
      sApellido,
      email,
      fechaNacimiento,
    };

    // AquÃ­ debes colocar la URL de tu API para el registro
    axios.post('http://tu_api_url/persona', personaData)
      .then(response => {
        console.log('Registro exitoso:', response.data);
      })
      .catch(error => {
        console.error('Error al registrar:', error);
      });
  };

  const calculateAge = (fechaNac) => {
    const today = new Date();
    const birthDate = new Date(fechaNac);
    let age = today.getFullYear() - birthDate.getFullYear();
    const monthDiff = today.getMonth() - birthDate.getMonth();
    if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
      age--;
    }
    return age;
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center">Registro de Persona</h2>
      <div className="card p-4">
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Primer Nombre:</label>
            <input
              type="text"
              className="form-control"
              value={pnombre}
              onChange={(e) => setPnombre(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">UbicaciÃ³n:</label>
            <input
              type="text"
              className="form-control"
              value={ubicacion}
              onChange={(e) => setUbicacion(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">IdentificaciÃ³n:</label>
            <input
              type="number"
              className="form-control"
              value={identificacion}
              onChange={(e) => setIdentificacion(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Segundo Nombre:</label>
            <input
              type="text"
              className="form-control"
              value={sNombre}
              onChange={(e) => setSNombre(e.target.value)}
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Primer Apellido:</label>
            <input
              type="text"
              className="form-control"
              value={pApellido}
              onChange={(e) => setPApellido(e.target.value)}
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Segundo Apellido:</label>
            <input
              type="text"
              className="form-control"
              value={sApellido}
              onChange={(e) => setSApellido(e.target.value)}
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Email:</label>
            <input
              type="email"
              className="form-control"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Fecha de Nacimiento:</label>
            <input
              type="date"
              className="form-control"
              value={fechaNacimiento}
              onChange={(e) => setFechaNacimiento(e.target.value)}
              required
            />
          </div>
          <div className="text-center">
            <button type="submit" className="btn btn-primary">Registrar</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Register;
